Durante el Shock Externo de la pandemia mundial podemos observar que las variables más elásticas fueron el Bitcoin y el Nasdaq
Posterior al shock el índice Nasdaq siguió su curso con tendencia alcista, el Bitcoin llego a récord histórico, el Oro tuvo una leve suba y la relación entre las monedas se mantiene constante, cada una con una trayectoria de pérdida de poder adquisitivo producto de la inflación.
