Se utiliza uno de los algoritmos iniciales de IA para buscar máximos y mínimos locales de una función polinómica de tercer grado. El código toma datos macroeconómicos de Argentina. El trabajo busca encontrar la presión tributaria que hace mínima y máxima la recaudación en términos reales para los últimos 60 años en Argentina.
Se puede observar un mínimo local y un máximo local. Comparto el código y el dashboard final más abajo.
